import React from "react";
import styled from "styled-components";
import { HobbyCard } from "../../share-components/Cards/HobbyCard";

const Hobby = ()=>{
    return(
        <Wrapper>
            <Title>
                My Hobbies
            </Title>
        <HobbyContainer>
            <HobbyCard Icon={"fas fa-music fa-3x"} isHover={true} name={"Music"} description={"I enjoy listening and playing music"}/>
            <HobbyCard Icon={"fas fa-gamepad fa-3x"} isHover={true} name={"Video Game"} description={"A gamer when I have free time"}/>
            <HobbyCard Icon={"fas fa-dumbbell fa-3x"} isHover={true} name={"Weightlifting"} description={"I like to lift heavy weight"}/>
            <HobbyCard Icon={"fas fa-plane fa-3x"} isHover={true} name={"Travel"} description={"Travel and explore new places"}/>
            <HobbyCard Icon={"fas fa-palette fa-3x"} isHover={true} name={"Art"} description={"Painting and drawing make me happy"}/>
        </HobbyContainer>
        </Wrapper>
    )
}


export {Hobby};

const Wrapper = styled.div`
display:flex;
flex-direction:row;
justify-content: center;
`;

const Title = styled.h1``;

const HobbyContainer = styled.div``;
